INSERT INTO `chart` VALUES ('1', '201604070101', '1', '2017-11-03 22:09:31', '第一周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '地球总是在转的，时间在一秒一秒的过去，而我还是在为工作的事在发愁，天天去面试，去网吧上网投简历，重复的做同一样事情，结果都是一样。但是我还是没有放弃，而是继续在寻找符合自己的工作，身上的钱花了差不多，这时候的我跟是万分的焦急，又不怎么好意思在开口往家里的人要。终于工夫不负有心人，让我找到一分工作。', '1', '能真实记录自己在开始实习的一段时间里心里所想，所体会的内容，非常好！该生写日记的态度较为认真，从其日记中能看出其在不断进步。希望，在今后的实习生活中，除了不断学习本专业课程以外，还能与办公室其他同事沟通以了解物XX行业的最新近况。', '10', '0');
INSERT INTO `chart` VALUES ('9', '201604070101', '03994', '2018-10-18 07:48:15', '第二周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '地球总是在转的，时间在一秒一秒的过去，而我还是在为工作的事在发愁，天天去面试，去网吧上网投简历，重复的做同一样事情，结果都是一样。但是我还是没有放弃，而是继续在寻找符合自己的工作，身上的钱花了差不多，这时候的我跟是万分的焦急，又不怎么好意思在开口往家里的人要。终于工夫不负有心人，让我找到一分工作。', '1', '该篇周记真实记录了该生在进入实习第二周时，如何寻找客户，以及自己内心的感悟。写得真情实感，从中可以发现她的进步。望再接再厉在今后的实习岗位中能充分发挥自己的优势，同时能真正学习到联系客户以及与客户沟通的技巧。', '8', '1');
INSERT INTO `chart` VALUES ('68', '201604070104', '03994', '2018-10-25 11:22:10', '第一周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '　图是弄好了，接下来是开始进行生产，调试。真是毛病重重，错误多多啊!产品刚出来进行调试微出现这样那样的毛病。后来才清楚知道是怎么一回事。不过通过这件事可以学到不少在学校所学不到的知识与经验，原来在设计绘图，这个零件是考虑的并不单单是把图绘出来，还要了解一些关于市场方面的信息，比如说价格，一些常用的毛坯，怎么做起来才方便简洁，如何把他设计成又好又方便的产品。还要考虑在加工过程中出现的误差，还有一些热处理方面的知识等等。如果不想到这些结果会是难以想象的，浪费时间上其次的，最重要的是公司经济的损失。', '1', '本周你给自己定的目标是：如何将询价单转换为订单。在此过程中，你的努 力你的感悟我能很真实感觉到。抓住客户获得忠实客户的技巧，书本上不一定能给你。但是你切实能在实践中针对不同的客户，用心去体会去感悟。这样，在经历多次失败后，你必定能收获自己的成功！加油！', '0', '1');
INSERT INTO `chart` VALUES ('69', '201604070104', '03994', '2018-10-25 11:43:54', '第二周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一个多月的实习，虽然对公司不是那么的太了解，但是多少不等也有所了解。天天做着一样的事，感觉得无比的枯燥只有自己一个人坐在电脑面前一整天，只有电脑从早到晚的陪者我，觉得好孤独，没有了以前在学校的那种欢声笑语，没有在学校的那种轻松悠闲自在了，有的只是空虚和寂寞。有些时候闲下来就坐在电脑面前发呆，不知道做什么。 就这样一天一天的耗着，感觉除了工作以外，自己的生活中就没有其他的新鲜的事情，或者是值得人去回忆，留念的了，没有了色彩斑斓的生活，有的只是枯燥的工作有些时候都有点冲动想不干了，去换换别的工作，想给累积更多的社会知识和经验，但是想了想还没有那么的冲动，还是在原来的地方老实的呆着。', '1', '能真实记录自己在开始实习的一段时间里心里所想，所体会的内容，非常好！该生写日记的态度较为认真，从其日记中能看出其在不断进步。希望，在今后的实习生活中，除了不断学习本专业课程以外，还能与办公室其他同事沟通以了解物XX行业的最新近况。', '0', '1');
INSERT INTO `chart` VALUES ('70', '201604070102', '02112', '2018-10-25 02:56:52', '第一周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '俗话说的好一年之季在于春，一天之季在于晨，又是一个星期的开始，早上起来呼吸着窗外的新鲜空气，来到厂里开始新的工作，将上个星期的零件图把他装配起来，我以为本来是很简单的事，不过事实并不是想象中的那样的简单，在装配过程中出现了许多问题，这下可把我个弄荤了，都不知道该从何下手，比如说在装配的过程中出现尺寸的不一样，出现很大的间隙等等其他的许多问题，一时间看出许多的毛病和错误，只好在次慢慢的修改，寻找还有没有其他的错误。经过几天的奋斗，修改和检查这个工作快临近尾声了，我总是在希望我的图不要在出现其他的错误。这个星期虽然结束了，但是我还是有地方值得我去学习的，真的是不易乐呼。', '0', null, '0', '1');
INSERT INTO `chart` VALUES ('71', '201604070101', '03994', '2018-10-25 06:27:54', '第三周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一周的实习，对公司的运作流程也有了一些了解，虽然还没有具体的操作过，但是在接触到新的事务不再不知所措，学会了如何去处理一些突发事件。懂得从中学到一定的处理事情的发那个发，而且从工作地过程中明白了主动出击的重要性，在你可以选择的时候，就要把主动权握在自己手中。相信大家刚开始实习的时候，都做过类似复印打字、整理文档等的杂活，因为刚开始对于公司的工作内容、流程还不了解，所以做杂活成了实习工作必做的工作。虽然工作比较繁杂但是从中也学到不少的东西。所以说事情是不分大小，只要积极学习积极办事，做好份内事，勤学、勤问、勤做，就会有意想不到的收获。', '1', '每周都有自己学习的主题和目标，这个非常非常棒。从中我真的能看到你们一点点的进步。本周的主题是学习各国家的主要港口和航线，并熟练记忆他们。这进入物流企业必须要学会的必修课！加油！', '6', '1');
INSERT INTO `chart` VALUES ('72', '201604070101', '03994', '2018-10-25 09:20:37', '第四周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '在经历了一周的打杂工作，让我对公司的运作流程以及业务有了一个整体的了解，因此这一周我们的工作内容也有了一个小变化，除了进行简单的技术资料整理， 还有就是如何去做好这个产品方面的设计，我本来以为就要将具体的尺寸用工具测量出来，然后通过AUTOCAD画出来就可以了，但是结果并不是想象中那么简单。老板总是叫我一遍又一遍的检查画的图是否还有其他的错误，经过几天的检查，我开始感觉到一整天坐在电脑面前开始有些疲倦，整天面对着电脑，看着那枯燥无谓的图形，我有点开始厌倦了，但是我还是坚持着做着，细心的检查着。就这样我熬过了枯燥的一个星期。', '1', '本周的实习内容不单单是进行客户资料的输入，了解XXXX的相关业务知识。同时，你还在联系客户方面迈出了自己坚实的一步。尝试着开始用电话和客户沟通。 这就是实习的乐趣和实习的收获。每天都在一点点进步，每天都在一点点学习。 实习日记很真实并详尽的记录了你学习与进步的点点滴滴。加油！', '4', '1');
INSERT INTO `chart` VALUES ('73', '201604070101', '03994', '2018-10-25 09:26:16', '第五周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '俗话说的好一年之季在于春，一天之季在于晨，又是一个星期的开始，早上起来呼吸着窗外的新鲜空气，来到厂里开始新的工作，将上个星期的零件图把他装配起来，我以为本来是很简单的事，不过事实并不是想象中的那样的简单，在装配过程中出现了许多问题，这下可把我个弄荤了，都不知道该从何下手，比如说在装配的过程中出现尺寸的不一样，出现很大的间隙等等其他的许多问题，一时间看出许多的毛病和错误，只好在次慢慢的修改，寻找还有没有其他的错误。经过几天的奋斗，修改和检查这个工作快临近尾声了，我总是在希望我的图不要在出现其他的错误。这个星期虽然结束了，但是我还是有地方值得我去学习的，真的是不易乐呼。', '1', '多听，多看，多想，多问 是实习过程中非常重要的几个步骤。学会和客户如何沟通，是你做这行必须掌握的技巧。 从你的实习日记中看，你已经做得非常好了！加油！相信在今后的工作岗位上，你能非常棒非常快速的适应全新的工作环境。加油！', '5', '1');
INSERT INTO `chart` VALUES ('74', '201604070101', '03994', '2018-10-25 09:33:39', '第六周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '　图是弄好了，接下来是开始进行生产，调试。真是毛病重重，错误多多啊!产品刚出来进行调试微出现这样那样的毛病。后来才清楚知道是怎么一回事。不过通过这件事可以学到不少在学校所学不到的知识与经验，原来在设计绘图，这个零件是考虑的并不单单是把图绘出来，还要了解一些关于市场方面的信息，比如说价格，一些常用的毛坯，怎么做起来才方便简洁，如何把他设计成又好又方便的产品。还要考虑在加工过程中出现的误差，还有一些热处理方面的知识等等。如果不想到这些结果会是难以想象的，浪费时间上其次的，最重要的是公司经济的损失。', '1', '本周你给自己定的目标是：如何将询价单转换为订单。在此过程中，你的努 力你的感悟我能很真实感觉到。抓住客户获得忠实客户的技巧，书本上不一定能给你。但是你切实能在实践中针对不同的客户，用心去体会去感悟。这样，在经历多次失败后，你必定能收获自己的成功！加油！', '7', '1');
INSERT INTO `chart` VALUES ('75', '201604070101', '03994', '2018-10-25 09:33:44', '第7周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一个多月的实习，虽然对公司不是那么的太了解，但是多少不等也有所了解。天天做着一样的事，感觉得无比的枯燥只有自己一个人坐在电脑面前一整天，只有电脑从早到晚的陪者我，觉得好孤独，没有了以前在学校的那种欢声笑语，没有在学校的那种轻松悠闲自在了，有的只是空虚和寂寞。有些时候闲下来就坐在电脑面前发呆，不知道做什么。 就这样一天一天的耗着，感觉除了工作以外，自己的生活中就没有其他的新鲜的事情，或者是值得人去回忆，留念的了，没有了色彩斑斓的生活，有的只是枯燥的工作有些时候都有点冲动想不干了，去换换别的工作，想给累积更多的社会知识和经验，但是想了想还没有那么的冲动，还是在原来的地方老实的呆着。', '1', '能真实记录自己在开始实习的一段时间里心里所想，所体会的内容，非常好！该生写日记的态度较为认真，从其日记中能看出其在不断进步。希望，在今后的实习生活中，除了不断学习本专业课程以外，还能与办公室其他同事沟通以了解物XX行业的最新近况。', '8', '1');
INSERT INTO `chart` VALUES ('76', '201604070101', '03994', '2018-10-25 09:33:49', '第8周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一个多月的实习，虽然对公司不是那么的太了解，但是多少不等也有所了解。天天做着一样的事，感觉得无比的枯燥只有自己一个人坐在电脑面前一整天，只有电脑从早到晚的陪者我，觉得好孤独，没有了以前在学校的那种欢声笑语，没有在学校的那种轻松悠闲自在了，有的只是空虚和寂寞。有些时候闲下来就坐在电脑面前发呆，不知道做什么。 就这样一天一天的耗着，感觉除了工作以外，自己的生活中就没有其他的新鲜的事情，或者是值得人去回忆，留念的了，没有了色彩斑斓的生活，有的只是枯燥的工作有些时候都有点冲动想不干了，去换换别的工作，想给累积更多的社会知识和经验，但是想了想还没有那么的冲动，还是在原来的地方老实的呆着。', '1', '该篇周记真实记录了该生在进入实习第二周时，如何寻找客户，以及自己内心的感悟。写得真情实感，从中可以发现她的进步。望再接再厉在今后的实习岗位中能充分发挥自己的优势，同时能真正学习到联系客户以及与客户沟通的技巧。', '6', '1');
INSERT INTO `chart` VALUES ('77', '201604070101', '03994', '2018-10-25 09:33:54', '第9周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '临近毕业的最后一年，是我们真正实习生活的开始，是汇报我们这三年来在学校学习成果的开始，是步入社会大展宏图的开始，我对社会充满了信心和对我自己充满自信参加了多场的招聘会、面试了多家的公司、但是一次又一次的失落快把我刚丛那学校里出来的一腔热情磨灭了，自己好回念当时在学校读书的时光，但是时间是不可能倒流根本就无法回到过去，每天拖这沉重的脚步穿梭在这个繁华的城市间。就象一个没有头的苍蝇到处乱撞，没有目标更没有方向，时间是那样的残酷，一个星期就这样过去了，没什么成功的收获，有的只是失败与无奈。', '1', '每周都有自己学习的主题和目标，这个非常非常棒。从中我真的能看到你们一点点的进步。本周的主题是学习各国家的主要港口和航线，并熟练记忆他们。这进入物流企业必须要学会的必修课！加油！', '14', '1');
INSERT INTO `chart` VALUES ('78', '201604070101', '03994', '2018-10-25 09:34:11', '第10周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '地球总是在转的，时间在一秒一秒的过去，而我还是在为工作的事在发愁，天天去面试，去网吧上网投简历，重复的做同一样事情，结果都是一样。但是我还是没有放弃，而是继续在寻找符合自己的工作，身上的钱花了差不多，这时候的我跟是万分的焦急，又不怎么好意思在开口往家里的人要。终于工夫不负有心人，让我找到一分工作。', '0', null, '18', '1');
INSERT INTO `chart` VALUES ('79', '201604070101', '03994', '2018-10-25 09:34:18', '第11周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一周的实习，对公司的运作流程也有了一些了解，虽然还没有具体的操作过，但是在接触到新的事务不再不知所措，学会了如何去处理一些突发事件。懂得从中学到一定的处理事情的发那个发，而且从工作地过程中明白了主动出击的重要性，在你可以选择的时候，就要把主动权握在自己手中。相信大家刚开始实习的时候，都做过类似复印打字、整理文档等的杂活，因为刚开始对于公司的工作内容、流程还不了解，所以做杂活成了实习工作必做的工作。虽然工作比较繁杂但是从中也学到不少的东西。所以说事情是不分大小，只要积极学习积极办事，做好份内事，勤学、勤问、勤做，就会有意想不到的收获。', '0', null, '15', '1');
INSERT INTO `chart` VALUES ('80', '201604070101', '03994', '2018-10-26 07:05:45', '第12周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', ' 你你开心哦一个撒同意色儿影碟行弟弟喜盈门 你你开心哦 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行 你    你你开心哦一个撒同意色儿影碟行弟弟喜盈门你开心哦一个撒同意色儿影碟行 你你开心哦一个撒同意色儿影碟行弟弟喜盈门 你你开心哦一个撒同意色儿影碟行弟弟喜盈门盈门你开心哦一个撒同意色儿影碟行弟弟喜盈门你开心哦一个撒同意色儿影碟行弟弟喜盈门开心哦一个撒同意色儿影碟行弟弟喜盈门 你你开心哦一个撒同意色儿影碟行弟弟喜盈门盈门 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行弟弟喜盈门门撒同意色儿影碟行弟弟喜盈门 你你开心哦一个撒同意色儿影碟行弟弟喜盈门', '1', '本周你给自己定的目标是：如何将询价单转换为订单。在此过程中，你的努 力你的感悟我能很真实感觉到。抓住客户获得忠实客户的技巧，书本上不一定能给你。但是你切实能在实践中针对不同的客户，用心去体会去感悟。这样，在经历多次失败后，你必定能收获自己的成功！加油！', '10', '1');
INSERT INTO `chart` VALUES ('81', '201604070101', '03994', '2018-10-26 09:38:29', '第13周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '在经历了一周的打杂工作，让我对公司的运作流程以及业务有了一个整体的了解，因此这一周我们的工作内容也有了一个小变化，除了进行简单的技术资料整理， 还有就是如何去做好这个产品方面的设计，我本来以为就要将具体的尺寸用工具测量出来，然后通过AUTOCAD画出来就可以了，但是结果并不是想象中那么简单。老板总是叫我一遍又一遍的检查画的图是否还有其他的错误，经过几天的检查，我开始感觉到一整天坐在电脑面前开始有些疲倦，整天面对着电脑，看着那枯燥无谓的图形，我有点开始厌倦了，但是我还是坚持着做着，细心的检查着。就这样我熬过了枯燥的一个星期。', '0', null, '8', '1');
INSERT INTO `chart` VALUES ('82', '201604070101', '03994', '2018-10-27 03:46:07', '14周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '俗话说的好一年之季在于春，一天之季在于晨，又是一个星期的开始，早上起来呼吸着窗外的新鲜空气，来到厂里开始新的工作，将上个星期的零件图把他装配起来，我以为本来是很简单的事，不过事实并不是想象中的那样的简单，在装配过程中出现了许多问题，这下可把我个弄荤了，都不知道该从何下手，比如说在装配的过程中出现尺寸的不一样，出现很大的间隙等等其他的许多问题，一时间看出许多的毛病和错误，只好在次慢慢的修改，寻找还有没有其他的错误。经过几天的奋斗，修改和检查这个工作快临近尾声了，我总是在希望我的图不要在出现其他的错误。这个星期虽然结束了，但是我还是有地方值得我去学习的，真的是不易乐呼。', '0', null, '8', '1');
INSERT INTO `chart` VALUES ('83', '201604070101', '03994', '2018-10-27 03:46:08', '第15周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '　图是弄好了，接下来是开始进行生产，调试。真是毛病重重，错误多多啊!产品刚出来进行调试微出现这样那样的毛病。后来才清楚知道是怎么一回事。不过通过这件事可以学到不少在学校所学不到的知识与经验，原来在设计绘图，这个零件是考虑的并不单单是把图绘出来，还要了解一些关于市场方面的信息，比如说价格，一些常用的毛坯，怎么做起来才方便简洁，如何把他设计成又好又方便的产品。还要考虑在加工过程中出现的误差，还有一些热处理方面的知识等等。如果不想到这些结果会是难以想象的，浪费时间上其次的，最重要的是公司经济的损失。', '0', null, '5', '1');
INSERT INTO `chart` VALUES ('84', '201604070101', '03994', '2018-10-27 03:46:10', '第16周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一个多月的实习，虽然对公司不是那么的太了解，但是多少不等也有所了解。天天做着一样的事，感觉得无比的枯燥只有自己一个人坐在电脑面前一整天，只有电脑从早到晚的陪者我，觉得好孤独，没有了以前在学校的那种欢声笑语，没有在学校的那种轻松悠闲自在了，有的只是空虚和寂寞。有些时候闲下来就坐在电脑面前发呆，不知道做什么。 就这样一天一天的耗着，感觉除了工作以外，自己的生活中就没有其他的新鲜的事情，或者是值得人去回忆，留念的了，没有了色彩斑斓的生活，有的只是枯燥的工作有些时候都有点冲动想不干了，去换换别的工作，想给累积更多的社会知识和经验，但是想了想还没有那么的冲动，还是在原来的地方老实的呆着。', '1', '本周的实习内容不单单是进行客户资料的输入，了解XXXX的相关业务知识。同时，你还在联系客户方面迈出了自己坚实的一步。尝试着开始用电话和客户沟通。 这就是实习的乐趣和实习的收获。每天都在一点点进步，每天都在一点点学习。 实习日记很真实并详尽的记录了你学习与进步的点点滴滴。加油！', '5', '1');
INSERT INTO `chart` VALUES ('85', '201604070101', '03994', '2018-10-27 03:46:46', '第17周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一个多月的实习，虽然对公司不是那么的太了解，但是多少不等也有所了解。天天做着一样的事，感觉得无比的枯燥只有自己一个人坐在电脑面前一整天，只有电脑从早到晚的陪者我，觉得好孤独，没有了以前在学校的那种欢声笑语，没有在学校的那种轻松悠闲自在了，有的只是空虚和寂寞。有些时候闲下来就坐在电脑面前发呆，不知道做什么。 就这样一天一天的耗着，感觉除了工作以外，自己的生活中就没有其他的新鲜的事情，或者是值得人去回忆，留念的了，没有了色彩斑斓的生活，有的只是枯燥的工作有些时候都有点冲动想不干了，去换换别的工作，想给累积更多的社会知识和经验，但是想了想还没有那么的冲动，还是在原来的地方老实的呆着。', '1', '多听，多看，多想，多问 是实习过程中非常重要的几个步骤。学会和客户如何沟通，是你做这行必须掌握的技巧。 从你的实习日记中看，你已经做得非常好了！加油！相信在今后的工作岗位上，你能非常棒非常快速的适应全新的工作环境。加油！', '32', '1');
INSERT INTO `chart` VALUES ('86', '201604070101', '03994', '2018-10-27 06:47:20', '第18周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '临近毕业的最后一年，是我们真正实习生活的开始，是汇报我们这三年来在学校学习成果的开始，是步入社会大展宏图的开始，我对社会充满了信心和对我自己充满自信参加了多场的招聘会、面试了多家的公司、但是一次又一次的失落快把我刚丛那学校里出来的一腔热情磨灭了，自己好回念当时在学校读书的时光，但是时间是不可能倒流根本就无法回到过去，每天拖这沉重的脚步穿梭在这个繁华的城市间。就象一个没有头的苍蝇到处乱撞，没有目标更没有方向，时间是那样的残酷，一个星期就这样过去了，没什么成功的收获，有的只是失败与无奈。', '1', '本周你给自己定的目标是：如何将询价单转换为订单。在此过程中，你的努 力你的感悟我能很真实感觉到。抓住客户获得忠实客户的技巧，书本上不一定能给你。但是你切实能在实践中针对不同的客户，用心去体会去感悟。这样，在经历多次失败后，你必定能收获自己的成功！加油！', '15', '1');
INSERT INTO `chart` VALUES ('87', '201604070101', '03994', '2018-10-29 01:26:06', '第19周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '地球总是在转的，时间在一秒一秒的过去，而我还是在为工作的事在发愁，天天去面试，去网吧上网投简历，重复的做同一样事情，结果都是一样。但是我还是没有放弃，而是继续在寻找符合自己的工作，身上的钱花了差不多，这时候的我跟是万分的焦急，又不怎么好意思在开口往家里的人要。终于工夫不负有心人，让我找到一分工作。', '1', '能真实记录自己在开始实习的一段时间里心里所想，所体会的内容，非常好！该生写日记的态度较为认真，从其日记中能看出其在不断进步。希望，在今后的实习生活中，除了不断学习本专业课程以外，还能与办公室其他同事沟通以了解物XX行业的最新近况。', '4', '1');
INSERT INTO `chart` VALUES ('88', '201604070101', '03994', '2018-10-29 03:14:47', '第20周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一周的实习，对公司的运作流程也有了一些了解，虽然还没有具体的操作过，但是在接触到新的事务不再不知所措，学会了如何去处理一些突发事件。懂得从中学到一定的处理事情的发那个发，而且从工作地过程中明白了主动出击的重要性，在你可以选择的时候，就要把主动权握在自己手中。相信大家刚开始实习的时候，都做过类似复印打字、整理文档等的杂活，因为刚开始对于公司的工作内容、流程还不了解，所以做杂活成了实习工作必做的工作。虽然工作比较繁杂但是从中也学到不少的东西。所以说事情是不分大小，只要积极学习积极办事，做好份内事，勤学、勤问、勤做，就会有意想不到的收获。', '1', '今天不错偶', '1', '1');
INSERT INTO `chart` VALUES ('89', '201604070101', '03994', '2018-10-29 03:45:52', '第21周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', ' 你你开心哦一个撒同意色儿影碟行弟弟喜盈门 你你开心哦 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行 你    你你开心哦一个撒同意色儿影碟行弟弟喜盈门你开心哦一个撒同意色儿影碟行 你你开心哦一个撒同意色儿影碟行弟弟喜盈门 你你开心哦一个撒同意色儿影碟行弟弟喜盈门盈门你开心哦一个撒同意色儿影碟行弟弟喜盈门你开心哦一个撒同意色儿影碟行弟弟喜盈门开心哦一个撒同意色儿影碟行弟弟喜盈门 你你开心哦一个撒同意色儿影碟行弟弟喜盈门盈门 你你开心哦一个撒同意色儿影碟行弟弟喜 你你开心哦一个撒同意色儿影碟行弟弟喜盈门门撒同意色儿影碟行弟弟喜盈门 你你开心哦一个撒同意色儿影碟行弟弟喜盈门', '0', null, '3', '1');
INSERT INTO `chart` VALUES ('90', '201604070101', '03994', '2018-10-29 04:20:10', '第22周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '在经历了一周的打杂工作，让我对公司的运作流程以及业务有了一个整体的了解，因此这一周我们的工作内容也有了一个小变化，除了进行简单的技术资料整理， 还有就是如何去做好这个产品方面的设计，我本来以为就要将具体的尺寸用工具测量出来，然后通过AUTOCAD画出来就可以了，但是结果并不是想象中那么简单。老板总是叫我一遍又一遍的检查画的图是否还有其他的错误，经过几天的检查，我开始感觉到一整天坐在电脑面前开始有些疲倦，整天面对着电脑，看着那枯燥无谓的图形，我有点开始厌倦了，但是我还是坚持着做着，细心的检查着。就这样我熬过了枯燥的一个星期。', '1', '加油哦，老师看好你哦', '13', '1');
INSERT INTO `chart` VALUES ('91', '201604070101', '03994', '2018-10-29 04:20:10', '第23周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '俗话说的好一年之季在于春，一天之季在于晨，又是一个星期的开始，早上起来呼吸着窗外的新鲜空气，来到厂里开始新的工作，将上个星期的零件图把他装配起来，我以为本来是很简单的事，不过事实并不是想象中的那样的简单，在装配过程中出现了许多问题，这下可把我个弄荤了，都不知道该从何下手，比如说在装配的过程中出现尺寸的不一样，出现很大的间隙等等其他的许多问题，一时间看出许多的毛病和错误，只好在次慢慢的修改，寻找还有没有其他的错误。经过几天的奋斗，修改和检查这个工作快临近尾声了，我总是在希望我的图不要在出现其他的错误。这个星期虽然结束了，但是我还是有地方值得我去学习的，真的是不易乐呼。', '0', null, '3', '1');
INSERT INTO `chart` VALUES ('92', '201604070101', '03994', '2018-10-30 04:00:16', '24周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '　图是弄好了，接下来是开始进行生产，调试。真是毛病重重，错误多多啊!产品刚出来进行调试微出现这样那样的毛病。后来才清楚知道是怎么一回事。不过通过这件事可以学到不少在学校所学不到的知识与经验，原来在设计绘图，这个零件是考虑的并不单单是把图绘出来，还要了解一些关于市场方面的信息，比如说价格，一些常用的毛坯，怎么做起来才方便简洁，如何把他设计成又好又方便的产品。还要考虑在加工过程中出现的误差，还有一些热处理方面的知识等等。如果不想到这些结果会是难以想象的，浪费时间上其次的，最重要的是公司经济的损失。', '0', null, '4', '1');
INSERT INTO `chart` VALUES ('93', '201604070101', '03994', '2018-10-30 06:57:25', '第25周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一个多月的实习，虽然对公司不是那么的太了解，但是多少不等也有所了解。天天做着一样的事，感觉得无比的枯燥只有自己一个人坐在电脑面前一整天，只有电脑从早到晚的陪者我，觉得好孤独，没有了以前在学校的那种欢声笑语，没有在学校的那种轻松悠闲自在了，有的只是空虚和寂寞。有些时候闲下来就坐在电脑面前发呆，不知道做什么。 就这样一天一天的耗着，感觉除了工作以外，自己的生活中就没有其他的新鲜的事情，或者是值得人去回忆，留念的了，没有了色彩斑斓的生活，有的只是枯燥的工作有些时候都有点冲动想不干了，去换换别的工作，想给累积更多的社会知识和经验，但是想了想还没有那么的冲动，还是在原来的地方老实的呆着。', '0', null, '10', '1');
INSERT INTO `chart` VALUES ('96', '201604070101', '03994', '2018-10-31 10:24:47', '第26周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '经过一个多月的实习，虽然对公司不是那么的太了解，但是多少不等也有所了解。天天做着一样的事，感觉得无比的枯燥只有自己一个人坐在电脑面前一整天，只有电脑从早到晚的陪者我，觉得好孤独，没有了以前在学校的那种欢声笑语，没有在学校的那种轻松悠闲自在了，有的只是空虚和寂寞。有些时候闲下来就坐在电脑面前发呆，不知道做什么。 就这样一天一天的耗着，感觉除了工作以外，自己的生活中就没有其他的新鲜的事情，或者是值得人去回忆，留念的了，没有了色彩斑斓的生活，有的只是枯燥的工作有些时候都有点冲动想不干了，去换换别的工作，想给累积更多的社会知识和经验，但是想了想还没有那么的冲动，还是在原来的地方老实的呆着。', '0', null, '23', '1');
INSERT INTO `chart` VALUES ('97', '201604070101', '03994', '2018-11-02 10:15:37', '第27周周记', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/20161540967728484.png,', '临近毕业的最后一年，是我们真正实习生活的开始，是汇报我们这三年来在学校学习成果的开始，是步入社会大展宏图的开始，我对社会充满了信心和对我自己充满自信参加了多场的招聘会、面试了多家的公司、但是一次又一次的失落快把我刚丛那学校里出来的一腔热情磨灭了，自己好回念当时在学校读书的时光，但是时间是不可能倒流根本就无法回到过去，每天拖这沉重的脚步穿梭在这个繁华的城市间。就象一个没有头的苍蝇到处乱撞，没有目标更没有方向，时间是那样的残酷，一个星期就这样过去了，没什么成功的收获，有的只是失败与无奈。', '1', '你妈死了', '63', '1');
INSERT INTO `chart` VALUES ('160', '201604070101', '03994', '2018-11-08 17:50:16', 'e', 'http://i3c8x94lqb.51http.tech/TXGLwai/image/2016040701011541670616427.png,', '呵呵哒？', '0', null, '45', '1');
