INSERT INTO `jpush` VALUES ('471', 'admin', '201604070101', '\r\n　　一、熟悉内容\r\n　　作为将要参加毕业论文答辩的同学，首先而且必须对自己所著的论文内容有比较深刻\r\n　　的理解和比较全面的熟悉。所谓“深刻的理解”是对论文有横向的把握。这两方面是为回\r\n　　答答辩委员会成员就有关论文的深度及相关知识面而提出的问题所做的准备。例如，题为\r\n　　＜创建名牌产品发展民族产业＞的论文，答辩委员会成员可能会问“民族品牌”\r\n　　二、图表穿插\r\n　　任何毕业论文，无论是文科还是理科都或多或少地涉及到用图表表达论文观点的可能\r\n　　，故我认为应该有此准备。图表不仅是一种直观的表达观点的方法，更是一种调节答辩会\r\n　　气氛的手段，特别是对私人答辩委员会成员来讲，长时间地听述，听觉难免会有排斥性，\r\n　　不再对你论述的内容接纳吸收，这样，必然对你的毕业论文答辩成绩有所影响。所以，应\r\n　　该在答辩过程事适当穿插图表或类似图表的其它媒介以提高你的答辩成绩。', '2018-11-08 19:36:58', '00000000001', null, null);
